import character1Image from '../../../assets/images/character1.jpg';
import character2Image from '../../../assets/images/character2.jpg';
import character3Image from '../../../assets/images/character3.jpg';


function ImageSlider() {

    return (
      <div className='image-slider-container'>
          <img src={character1Image} alt="Character 1" />
          <img src={character2Image} alt="Character 2" />
          <img src={character3Image} alt="Character 3" />
      </div>
    );
  }

  export default ImageSlider;
